// File: contracts/CustomERC20PresetMinterPauser.sol
import "./ERC20PresetMinterPauser.sol";
// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

// its admin should be factory,
// after deployment set owner as factory and revoke own role
contract FDERC20Mintable is ERC20PresetMinterPauser {
    constructor(string memory name, string memory symbol, uint8 decs) public ERC20PresetMinterPauser(name, symbol) {}

    function init(string memory name, string memory symbol, address factoryowner, uint8 decimals) public {
        require(!hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "only callable by admin");
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(DEFAULT_ADMIN_ROLE, factoryowner);

        _setupDecimals(decimals);
         _name = name;
        _symbol = symbol;

        revokeRole(DEFAULT_ADMIN_ROLE, _msgSender());
    }
}
